import React from 'react'
import { FaUserFriends } from "react-icons/fa";
import { GrGroup } from "react-icons/gr";
import { FaFacebook } from "react-icons/fa";
import { BsFillBookmarksFill } from "react-icons/bs";
import { BsFillStopwatchFill } from "react-icons/bs";
import { MdEvent } from "react-icons/md";
import { GrTableAdd } from "react-icons/gr";
import { SiGoogleadsense } from "react-icons/si";
import { BiDonateBlood } from "react-icons/bi";
import { FaFacebookMessenger } from "react-icons/fa";
import { BiSave } from "react-icons/bi";
import { SiPagekit } from "react-icons/si";
import { BiUpArrowAlt } from "react-icons/bi";
import LeftItems from './LeftItems';

function Leftbar() {
    return (
        <div className="leftbar">
         
            <div className="leftside">
            <div style={{height:'30px',width:'30px',backgroundColor:'blue',borderRadius:'50px'}}></div>
           <div style={{height:'500px',width:'50px',display:'flex',flexDirection:'column',justifyContent:'space-around'}}>
              <LeftItems icon={<FaUserFriends style={{height:'25px',width:'25px'}}></FaUserFriends>} title="Jannat Islam"></LeftItems>
              <LeftItems icon={ <GrGroup style={{height:'25px',width:'25px'}}></GrGroup>} title="Jannat Islam"></LeftItems>
              <LeftItems icon={ <FaFacebook style={{height:'25px',width:'25px'}}></FaFacebook>} title="Friends"></LeftItems>
              <LeftItems icon={ <BsFillBookmarksFill style={{height:'25px',width:'25px'}}></BsFillBookmarksFill>} title="Jannat Islam"></LeftItems>
              <LeftItems icon={ <BsFillStopwatchFill style={{height:'25px',width:'25px'}}></BsFillStopwatchFill>} title="Friends"></LeftItems>
              <LeftItems icon={<MdEvent style={{height:'25px',width:'25px'}}></MdEvent>} title="Jannat Islam"></LeftItems>
              <LeftItems icon={ <GrTableAdd style={{height:'25px',width:'25px'}}></GrTableAdd>} title="Friends"></LeftItems>
              <LeftItems icon={ <SiGoogleadsense style={{height:'25px',width:'25px'}}></SiGoogleadsense>} title="Jannat Islam"></LeftItems> 
                <LeftItems icon={ <BiDonateBlood style={{height:'25px',width:'25px'}}></BiDonateBlood>} title="Friends"></LeftItems>
              <LeftItems icon={<FaFacebookMessenger style={{height:'25px',width:'25px'}}></FaFacebookMessenger>} title="Jannat Islam"></LeftItems>
              <LeftItems icon={<BiSave style={{height:'25px',width:'25px'}}></BiSave>} title="Jannat Islam"></LeftItems>
              <LeftItems icon={<SiPagekit style={{height:'25px',width:'25px'}}></SiPagekit>} title="Jannat Islam"></LeftItems>
              <LeftItems icon={<BiUpArrowAlt style={{height:'25px',width:'25px'}}></BiUpArrowAlt>} title="Jannat Islam"></LeftItems>

           
           
           

            </div> 
            </div>
          
            </div>
            
        
    )
}

export default Leftbar
